as, textura de imagens e sinais cerebrais. Juntas, essas perspectivas evidenciaro o amplo potencial interdisciplinar da rea.","styleRuns":[{"startIndex":0,"length":926,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTERFACE_THEME_DARK","value":4294967295},{"key":"USER_INTERFACE_THEME_LIGHT","value":4279440147}]}},"fontFamilyName":"Roboto"}]},"headerRuns":[{"startIndex":0,"length":926,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"}]}},{"videoDescriptionInfocardsSectionRenderer":{"sectionTitle":{"simpleText":"Forum da Ps-Graduao em Computao do Paran"},"creatorVideosButton":{"buttonRenderer":{"style":"STYLE_INACTIVE_OUTLINE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Vdeos"},"icon":{"iconType":"MY_VIDEOS"},"trackingParams":"CBMQ8FsiEwjk1eHm2IGQAxVzY0gAHar4MHc=","command":{"clickTrackingParams":"CBMQ8FsiEwjk1eHm2IGQAxVzY0gAHar4MHfKAQR9fFuY","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCDbzZ9YQgF77C1RI_pNx0jQ/videos","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCDbzZ9YQgF77C1RI_pNx0jQ","params":"EgZ2aWRlb3PyBgkKBzoAogECCAE%3D"}}}},"creatorAboutButton":{"buttonRenderer":{"style":"STYLE_INACTIVE_OUTLINE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Sobre"},"icon":{"iconType":"ACCOUNT_BOX"},"trackingParams":"CBIQ8FsiEwjk1eHm2IGQAxVzY0gAHar4MHc=","command":{"clickTrackingParams":"CBIQ8FsiEwjk1eHm2IGQAxVzY0gAHar4MHfKAQR9fFuY","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCDbzZ9YQgF77C1RI_pNx0jQ/about","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCDbzZ9YQgF77C1RI_pNx0jQ","params":"EgVhYm91dPIGBgoCMgBKAA%3D%3D"}}}},"sectionSubtitle":{"accessibility":{"accessibilityData":{"label":"925 inscritos"}},"simpleText":"925 inscritos"},"channelAvatar":{"thumbnails":[{"url":"https://yt3.ggpht.com/KpMrcI0yPguHgFjIN11Eb8ZJAhLD9dZonDV8nIgiFHqklH
